import './App.css';
import React,{useState} from "react";
import ReactTooltip from "react-tooltip";
import{
  ComposableMap,
  Geographies,
  Geography,
  Marker,Annotation,
  ZoomableGroup,
} from "react-simple-maps";

const marker=[
  {
    markerOffset: -11,
    name:"Delhi 100,00000",
    coordinbates:[77.1025,28.7041],

  },
  {
    markerOffset: -11,
    name:"Uruguay 100,000",
    coordinbates:[-70.7658,-50.5228],

  },
  {
    markerOffset: -11,
    name:"Peru 100,000",
    coordinbates:[-60.0152,-9.1900],

  },
  {
    markerOffset: -11,
    name:"Paris 500,000",
    coordinbates:[2.3522,48.8566],

  },
  {
    markerOffset: -11,
    name:"Nigeria 1000",
    coordinbates:[-9.6753,9.0820],

  },
  {
    markerOffset: -11,
    name:"Egypt 60,000",
    coordinbates:[30.8025,5.8206],

  },
  {
    markerOffset: -11,
    name:"Kenya 10,000",
    coordinbates:[15.9062,-25.0236],

  },
  {
    markerOffset: -11,
    name:"Moscow 60,000",
    coordinbates:[110.6173,55.7558],

  },
  {
    markerOffset: -11,
    name:"Tokyo 500,0000",
    coordinbates:[120.6503,35.6762],

  },
  {
    markerOffset: -11,
    name:"Indonesia 50,000",
    coordinbates:[113.9213,-30.7893],

  },
]

const geoUrl="https://raw.githubusercontent.com/zcreativelabs/react-simple-maps/master/topojson-maps/world-110m.json";

function App() {
  return (
    <div className="App" style={{
      width:"100%",
      height:"100%",
      display:"flex",
      flexDirection:"column",
      justifyContent:"center",
      alignItems:"center",
    }}>
     <h1>Map UI</h1>
     <div style={{width:"1400px",borderStyle:"double"}}>
       <ComposableMap data-tip="">
         <ZoomableGroup zoom={1}>
           {" "}
           <Geographies geography={geoUrl}>
           {({geographies})=>
           geographies.map((geo)=>(
             <Geography key={geo.rsmKey} geography={geo}/>
           ))
           }
         </Geographies>
         {
           marker.map(({name, coordinbates, markerOffset})=>(
             <Marker key={name} coordinates={coordinbates } lable="afgdnm">
                <circle r={14} fill="#db4dff" ></circle>
                <text textAnchor='"middle' class="radius" y={markerOffset} style={{fontFamily:"system-ui", fill:"#cccc00", fontSize:"12px"}}>
                  {name}                
                </text>
             </Marker>

           ))

         }
         <Annotation subject={[76.0000,29.2001]}
         dx={-88} dy={-30}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[42.1025,38.7041]}
         dx={-99} dy={-30}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[30.8025,5.8206]}
         dx={-99} dy={-10}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[120.6503,35.6762]}
         dx={-60} dy={-60}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[113.9213,-30.7893]}
         dx={10} dy={-230}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[113.9213,-30.7893]}
         dx={-90} dy={-210}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[113.9213,-30.7893]}
         dx={-430} dy={60}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         <Annotation subject={[77.1025,28.7041]}
         dx={0} dy={-230}
         connectorProps={
           {
             stroke:"#db4dff",
             strokeWidth:10,
             strokeLinecap:"round",
           }
         }
         >
         </Annotation>
         </ZoomableGroup>

       </ComposableMap>
     </div>
    </div>
  );
}

export default App;
